import { oneOf, bool, node, string } from 'prop-types';
import { BUTTON_TYPES } from './constants';

const Button = ({ id, disabled, type = BUTTON_TYPES.BUTTON, className, children}) => {
	return (
		<button
            id={id}
            disabled={disabled}
            type={type}
			className={`${className && className}`}
        >
            {children}
        </button>
	);
};

Button.propTypes = {
    id:string,
    disabled: bool,
    type: oneOf(Object.values(BUTTON_TYPES)),
	children: node,
	className: string,
};

export default Button;
